#include <iostream>
int main(int argc, char** argv) {
std::cout << "Hello, World!" << std::endl;
return 0;
}
std::cout << "Hello, World!" << std::endl; <- с помощью глобальной переменной cout класса ostream, отвечающую за стандартный поток вывода, выводим с использованием оператора << строчку Hello, World! (строчки заключаются в кавычки), затем указываем манипулятор endl (end line), сбрасывающий буфер указанного в начале потока вывода и переводящий вывод на новую строку.
return 0; <- возвращаемое значение функции, в данном случае exit code приложения. По умолчанию успешное завершение приложения обозначается числом 0.
} <- выходим из области видимости функции, заканчивая ее определение.
